## 1. Inline Styles

Inline styles are the most basic way to style a react app. You can use the style prop to add inline styles to any element. For example:
```
<div style={{ color: 'red', fontSize: '20px' }}>Hello World!</div>
```
## 2. CSS Modules

CSS Modules allow you to write CSS in a modular way, where each CSS file is scoped to a specific component. This means that you can use the same class name in different components without worrying about conflicts. To use CSS Modules in a react app, you need to install the css-loader and style-loader packages. Then, you can import a CSS file into a react component like this:
```
import React from 'react';
import styles from './styles.css';

const App = () => {
  return <div className={styles.app}>Hello World!</div>;
};

export default App;
```
## 3. Styled Components

Styled Components is a library that allows you to write CSS in a more declarative way. Instead of using the className prop, you can use the styled() function to create a new component with the desired styles

